/*  bitbucket.org -- Dark Theme by viilo [0.10]
*/
@namespace url(http://www.w3.org/1999/xhtml);

code, pre {
        font-family: "Ubuntu Mono",Consolas,Menlo,"Liberation Mono",Courier,monospace;
        font-size: 13px;
    }

    body {
        background: url("http://i.imgur.com/7Prf6.jpg") #222
            top left repeat-y fixed !important;
        color: #8a8 !important;
    }

    #footer {
        background: rgba( 0,0,0, 0.5 ) !important;
        border-top: 1px solid #444 !important;
        position: relative;
    }

    .hero,
    .features,
    .pricing .users,
    header.subhead.row {
        background: rgba( 0,0,0, 0.1 ) !important;
    }

    nav#dashboard-tabs,
    nav#repo-tabs,
    .aui-navbar {
        background-color: rgba( 80,80,80, 0.1 ) !important;
        border-top: 1px solid #000 !important;
        border-bottom: 1px solid #000 !important;
    }

    .aui-lozenge,
    .bb-list .branch,
    .aui-badge {
        color: #ccc !important;
        background-color: #444 !important;
    }

    .aui-lozenge.selected {
        background: #aca !important;
        color: #222 !important;
    }

    .dialog-title,
    .bb-list .branch a,
    .aui-navbar a {
        color: #888 !important;
    }

    .aui-header {
        background: rgba( 80,80,80, 0.2 ) !important;
        border-bottom: 1px solid #000 !important;
    }

    .aui-nav-vertical a,
    .aui-dropdown2.aui-style-default a,
    .aui-header a {
        color: #8a8 !important;
    }
    
    .aui-dropdown2.aui-style-default a {
        background: rgb( 30,30,30 ) !important;
    }

    /* green background with gradient and bright text */
    .aui-nav .aui-nav-selected a,
    .aui-nav a:hover,
    nav#dashboard-tabs a:hover,
    nav#repo-tabs a:hover, 
    .aui-nav a:focus,
    .aui-nav-vertical a:hover,
    .aui-nav-vertical .active,
    .aui-dropdown2.aui-style-default a:hover,
    .aui-header a:hover,
    .aui-dropdown2.aui-style-default .active,
    .aui-header .active {
        background: #242 !important;
        background: -moz-linear-gradient( top, #242, #353 ) !important;
        color: #bcb !important;
    }

    .aui-dropdown2.aui-style-default {
        background: rgba( 30,30,30, 0.96 ) !important;
        border: 1px solid #000 !important;
    }

    .aui-style-default .aui-dropdown2-section + .aui-dropdown2-section {
        border-top: 1px solid #000 !important;
    }

    .clone-url input,
    .aui-header .aui-quicksearch input {
        background: #444 !important;
        color: #aaa !important;
    }

    input.user-or-email,
    .clone-url input {
        border-color: #000 !important;
    }

    .clone-url input::-moz-selection,
    .aui-header .aui-quicksearch input::-moz-selection {
        background-color: #000 !important;
    }

    .filter-control a,
    .aui-button, a.aui-button,
    .aui-button:focus, a.aui-button:hover {
        background: -moz-linear-gradient(
            center top , 
            rgb(30, 30, 30) 0%, 
            rgb(40, 40, 40) 100%
        ) repeat scroll 0% 0% transparent !important;
        border-color: #000 !important;
        color: #888 !important;
        text-shadow: 0px 1px 0px #000 !important;
    }

    .filter-control a:hover,
    .filter-control li[aria-pressed="true"] a {
        color: #444 !important;
        background: #888 !important;
    }

    .chzn-drop,
    .chzn-container, 
    .chzn-single,
    .aui-inline-dialog .contents {
        background: rgba( 30,30,30, 0.9 ) !important;
        border-color: #000 !important;
    }

    input[type="url"], input[type="email"], input[type="password"], 
    input[type="text"], input[type="search"], textarea {
        background: rgba( 0,0,0, 0.4 ) !important;
    }

    form.aui .text, form.aui .password, form.aui .textarea, 
    form.aui .select, form.aui .multi-select {
        box-shadow: 0px 1px 3px rgb( 80,80,80 ) inset !important;
        border-color: #000 !important;
        color: #8a8 !important;
    }

    fieldset label {
        color: #888 !important;
    }

    a.repo .slug {
        font-weight: bold !important;
        color: #597 !important;
    }

    a {
        color: #486 !important;
    }

    /* gray background with opacity */
    table.aui > tbody > tr,
    .stash,
    .pricing,
    .tourSection,
    .login-box,
    .workflow-box,
    .toolbar,
    .linenos,
    .readme.file code,
    .readme.file pre,
    #wiki-content pre,
    #wiki-content code,
    .docutils.literal,
    .literal-block,
    .plaintext,
    .markItUpHeader,
    #user-actions,
    .user-list ol,
    .bb-list .form,
    .bb-list > tbody > tr,
    .repo-links-list tr,
    #active-sessions tr,
    #inactive-sessions tr,
    #ssh-keys tr,
    #group-access tr,
    #user-access tr,
    .clone-url,
    #invite-repo-box,
    .newsfeed-banner,
    #share-dialog,
    .dialog-page-body,
    .invite-users-box {
        background: rgba( 80,80,80, 0.4) !important;
        border-color: #000 !important;
        color: #8a8 !important;
    }

    #share-dialog {
        background: rgba( 40,40,40, 0.9) !important;
    }

    #repo-content {
        background: rgba( 80,80,80, 0.2) !important;
        border-left: 1px solid #000 !important;
        border-right: 1px solid #000 !important;
        margin-left: -1px !important;
        margin-right: -1px !important;
    }

    .tabbed-filter-widget .tabbed-filter {
        background: rgba( 80,80,80, 0.2 ) !important;
        border-color: #000 !important;
    }

    .iterable-item,
    .tabbed-filter-widget.filter-list {
        background: rgba( 80,80,80, 0.2 ) !important;
    }

    .aui th {
        border-bottom: 1px solid #000 !important;
    }

    .bb-list > tbody > tr:first-child {
        border-top: 1px solid #000 !important;
    }

    .dashboard-overview--repositories,
    #providers a,
    .pricing .users,
    #pricing-row,
    .features,
    .features ul li,
    .features ul,
    .questions,
    .hero,
    .cta,
    .featuredItem,
    .login-box .form-container,
    .workflow-box .form-container,
    .openSource,
    .file-source,
    #wiki-content,
    .literal-block,
    .issue-attrs,
    #issue-main-content,
    #id_new_comment,
    #issues h1,
    .main,
    .markItUpEditor,
    .markItUpButton.separator,
    .textarea-preview,
    #account-admin-header,
    #notification-body,
    #notification-header,
    .profile-header,
    .aui h2,
    .bb-list.form,
    .aui-item,
    .aui-nav,
    .chzn-single div,
    .avatar-view,
    #pjax-main,
    #add-download,
    #tag-downloads .empty,
    .aui-lozenge,
    .bb-list .branch,
    .bb-list .branch-header,
    #commits .filter-box input,
    #commit-filter input,
    #source-path h1,
    .iterable-item,
    .aui-badge,
    #repo-activity, #invite-repo-box,
    .clone-url,
    .stats,
    .dialog-title,
    .dialog-button-panel,
    .metadata,
    .newsfeed,
    .newsfeed .commit,
    .newsfeed .commit .changeset,
    .newsfeed .news-item,
    .newsfeed .news-item p.additional-info,
    .repo-filter-widget,
    a.help-link,
    .commit-metadata,
    #general-comments h1,
    #commit-summary h1,
    .refract-container,
    .aui-tabs.horizontal-tabs > .tabs-menu,
    .fancybox-skin .diffract-sbsdiff,
    .fancybox-skin .diffract .scrollable-file-pane-lines,
    .tabbed-filter-widget .handle,
    .tabbed-filter-widget input.filter-box {
        border-color: #000 !important;
    }

    .refract-container .line-numbers,
    .refract-container .line-numbers-skipped,
    .bb-udiff .heading {
        background: rgba( 0,0,0, 0.5 ) !important;
        border-color: #000 !important;
    }

    .refract-container .line-numbers {
        color: #080 !important;
    }

    .fancybox-skin .diffract pre, 
    .refract-container pre.source {
        color: #666 !important;
    }

    .commit-files-summary .lines-removed,
    .commit-files-summary .lines-added,
    .refract-container .deletion pre.source del,
    .refract-container .addition pre.source ins {
        border-radius: 4px !important;
    /*    padding-left: 2px !important;
        margin-left: -2px !important;
        padding-right: 2px !important;
        margin-right: -2px !important; */
    }

    .fancybox-skin .diffract pre.addition,
    .refract-container .addition pre.source {
        color: #8a8 !important;
        background: rgba( 44,66,44, 0.5 ) !important;
    }

    .fancybox-skin .diffract pre.change ins,
    .commit-files-summary .lines-added,
    .refract-container .addition pre.source ins {
        color: #bfb !important;
        background-color: #484 !important;
    }

    .fancybox-skin .diffract pre.deletion,
    .refract-container .deletion pre.source {
        color: #a88 !important;
        background: rgba( 66,44,44, 0.5 ) !important;
    }

    .fancybox-skin .diffract pre.change del,
    .commit-files-summary .lines-removed,
    .refract-container .deletion pre.source del {
        color: #fbb !important;
        background-color: #a66 !important;
    }

    .skipped-container .ellipsis {
        border: 1px solid #000 !important;
        box-shadow: 0px 0px 0px 2px rgb(0,0,0) !important;
        color: #aaa !important;
        background: rgba( 0,0,0, 1.0 ) !important;
    }

    .fancybox-skin .diffract pre.change {
        color: #888 !important;
        background: rgba( 66,66,66, 0.5 ) !important;
    }

    .fancybox-skin {
        background: rgba( 40,40,40, 0.9 ) !important;
        color: #888 !important;
    }

    .fancybox-skin .diffract .page {
        border-color: #000 !important;
        background: #222 !important;
    }

    .fancybox-skin .diffract pre,
    .fancybox-skin .diffract pre.change,
    .fancybox-skin .diffract pre.change del,
    .fancybox-skin .diffract pre.change ins,
    .fancybox-skin .diffract pre.adddition {
    /*
        border-top: 1px solid #1f1f1f !important;
    */
        border-top: 0px solid #000 !important;
    /*    margin-top: 1px !important;*/
        padding-top: 1px !important;
    }
    /*
    .fancybox-skin .diffract pre.change del,
    .fancybox-skin .diffract pre.change ins {
        border-color: rgb( 66,66,66 ) !important;
    }

    .fancybox-skin .diffract pre.change {
        border-color: rgba( 66,66,66, 0.5 ) !important;
    }
    */
    ol.clearfix {
        background: none !important;
    }

    .changeset-hash {
        border: 1px solid #000 !important;
        padding: 1px 5px 1px 5px !important;
        border-radius: 4px !important;
    }

    .aui-tabs.tabs-menu.menu-item,
    .aui-tabs.tabs-menu,
    .aui-tabs a {
        border-color: #000 !important;
        background: #222 !important;
    }

    .aui-tabs .menu-item:first-child a,
    .aui-tabs .menu-item:last-child a {
        border-radius: 0px !important;
    }

    .chzn-single b {
        background-color: rgba( 0,0,0, 0.9 ) !important;
    }

    .aui-tabs .active-tab a,
    .aui-tabs a:active,
    .aui-tabs a:focus {
        background: rgba( 0,0,0, 0.9 ) !important;
    }

    #footer-logo,
    #wiki-content,
    .profile-header,
    .bb-list thead,
    .bb-list thead .branch-header,
    .iterable-item:hover,
    .aui-navbar a:hover,
    a.help-link:hover {
        background-color: rgba( 0,0,0, 0.3 ) !important;
    }

    .iterable-item {
        color: #8a8 !important;
    }

    .bb-list .fade-left,
    .bb-list .fade-left:before {
        background: none !important;
    }

    .bb-list thead a {
        color: #444 !important;
    }

