/* ##################----- Suggestions ----------######################*/
div.suggestions{opacity: .94!important; box-shadow:  #000 2px 2px 3px;background:#aaa !important}
div.suggestions * {border-color: #ccc!important}
div.suggestions-results, div.suggestions-special{background:transparent !important; }
.suggestions-result span, .special-query span{color:#333!important}
.special-label{color: #ddd!important;}
.suggestions-result-current span, div.suggestions-special.suggestions-result-current span, .suggestions-result-current , div.suggestions-special.suggestions-result-current {color: #ddd!important; background:#606060 !important }
