#p-coll-print_export, #mw-panel .portal:not(#p-lang):not(#p-navigation)
{display:none !important}
img[src*="Bluebg_rounded"]{visibility:hidden !important}
/* ################## ----- Main/welcome page ----- ####################### */
/*  --------- DE/Ger ------------- */
#hauptseite h2{background:  #383838!important;border:#B6AA7B solid 1px!important;}
