@-moz-document regexp("^https?://((chat|meta|es|ja|pt|ru)\\.)*stackoverflow\\.com.*"),
domain("serverfault.com"),
domain("superuser.com"),
domain("stackapps.com"),
domain("mathoverflow.net"),
domain("askubuntu.com"),
regexp("^https?://((?!(www|area51|gaming)).*\\.)?stackexchange\\.com.*") {
  /**
   * Stack Overflow Dark
   * https://github.com/StylishThemes/StackOverflow-Dark
   * http://userstyles.org/styles/35345
   * ** Will apply to almost all Stack Exchange Sites **
   * Except:
   * - Area 51 (area51.stackexchange.com)
   * - Gaming (gaming.stackexchange.com)
   * ** Please open an issue to report sites where the style breaks **
   * https://github.com/StylishThemes/StackOverflow-Dark/issues
   * previous version information contained at the userstyles site
   */
  * {
    border-color: #444 !important;
    text-shadow: none !important;
    box-shadow: none !important;
  }
  body {
    background-color: #191919 !important;
    background-image: /*[[bg-choice]]*/ !important;
    background-clip: border-box !important;
    background-origin: padding-box !important;
    background-attachment: /*[[bg-attachment]]*/ !important;
    /*[[bg-options]]*/
  }
  /* custom code font */
  pre.prettyprint, code {
    font-family: "/*[[font-choice]]*/",
      Monaco,
      Consolas,
      "Liberation Mono",
      Menlo,
      Courier,
      monospace !important;
  }
  /* === custom color === */
  a:not([class*="comment-"]), .profile-popup a, .seWrapper a, .gs-title b,
  .spoiler:hover a, .comment-up-on, .comment-up-off:hover {
    color: /*[[base-color]]*/ !important;
  }
  .nav .primarynav li a:hover, .message.message-config .actions .button,
  .btn-careers:hover, .btn-careers:visited, .question-list-layout a:hover {
    color: #fff !important;
    background: /*[[base-color]]*/ !important;
  }
  input[type="submit"].btn-clear, input[type="button"].btn-clear,
  button.btn-clear, .btn-clear {
    color: /*[[base-color]]*/ !important;
  }
  input[type="submit"].btn-clear:hover, input[type="button"].btn-clear:hover,
  button.btn-clear:hover, .btn-clear:hover, input[type="submit"].btn-clear:focus,
  input[type="button"].btn-clear:focus, button.btn-clear:focus, .btn-clear:focus {
    color: /*[[base-color]]*/ !important;
    background: #273045 !important;
  }
  a.post-tag:hover, .bounty-indicator, .bounty-indicator-tab, .bounty-award,
  span.bounty-indicator-tab, #change-picture, .supernovabg, .hotbg,
  .nav li.youarehere a, .nav a:hover, a.button:hover, .edit-count,
  .pager a:hover span, .bounties-tab, #sidebar a[href*="/questions/ask"],
  #sidebar a[href*="/questions/ask"]:visited, .page-numbers:hover,
  .s-btn.s-btn__primary, .s-btn.s-btn__primary:focus,
  .top-bar .-secondary .-ctas .btn-topbar-primary,
  .top-bar .-secondary .-ctas .btn-topbar-primary:focus,
  .user-card-name .top-badge, .user-card-name .top-badge a {
    background-color: /*[[base-color]]*/ !important;
    color: #eee !important;
  }
  #tabs a.youarehere:before, .tabs a.youarehere:before,
  .newnav .tabs-list-container .tabs-list .intellitab a.youarehere:before {
    background-color: /*[[base-color]]*/ !important;
  }
  .s-btn.s-btn__primary:hover, .top-bar .-secondary .-ctas .btn-topbar-clear,
  .top-bar .-secondary .-ctas .btn-topbar-clear:focus {
    filter: brightness(1.1) !important;
  }
  /* === text selection === */
  ::selection {
    background: /*[[base-color]]*/ !important;
    color: #fff !important;
  }
  ::-moz-selection {
    background: /*[[base-color]]*/ !important;
    color: #fff !important;
  }
  /* === input focus hightlight === */
  input:focus, textarea:focus,
  .chosen-container.chosen-container-active .chosen-choices,
  .chosen-container .active-result.highlighted {
    border-color: /*[[base-color]]*/ !important;
    box-shadow: inset 0 1px 2px rgba(0, 0, 0, .075), 0 0 2px /*[[base-color]]*/ !important;
    outline-color: transparent !important;
  }
  .tag-editor input:focus, .previous-button, .next-button, .btn-clear,
  .chosen-container.chosen-container-active .chosen-choices input,
  .gsc-webResult.gsc-result, .gsc-results .gsc-imageResult,
  .s-sidebarwidget:after, .profile-top-tags .badge-tag {
    border: 0 !important;
    box-shadow: none !important;
  }
  .profile-avatar {
    box-shadow: inset 0 10em 0 #333 !important;
  }
  .menu-switcher {
            filter: none !important;
    -webkit-filter: none !important;
  }
  /* === hidden === */
  div.hireme, div#hireme, .next-answer-hook-container, .intellitab:after,
  .s-hero .-container {
    display: none !important;
  }
  /* === background color === */
  /* from darkest to lightest grey */
  .popup-badges .all-badge-progress .completed:before, .previous-button,
  .next-button, #footer,
  /* === herobox when not logged in === */ #herobox.alternate, .message-title {
    background-color: rgba(0, 0, 0, .4) !important;
  }
  header {
    background-color: #080808 !important;
  }
  #custom-header, .review-bar, .diff-choices a.selected, #header #topbar,
  td.owner, a.owner, .question-status, .profile-popup, .profile-popup div,
  .profile-popup th, .profile-popup td, #global, .actual-edit-overlay,
  input:not([type="submit"]), textarea, #search input, .tag-editor,
  .f-select > select, textarea#input,
  .search-form .chosen-container .chosen-choices, .pac-container, select,
  #match-preferences-editor .close:hover, .gsc-input-box, .gsc-option-menu,
  .subheader, .min-ds-wizard .min-ds-box.jobs {
    background-color: #111 !important;
    color: #ddd !important;
  }
  .gsc-selected-option-container {
    background: #111 !important;
  }
