   * https://github.com/StylishThemes/StackOverflow-Dark
   * http://userstyles.org/styles/35345
   * ** Will apply to almost all Stack Exchange Sites **
   * Except:
   * - Area 51 (area51.stackexchange.com)
   * - Gaming (gaming.stackexchange.com)
